struct Solution;

impl Solution {
    pub fn two_sum(numbers: Vec<i32>, target: i32) -> Vec<i32> {
        let mut serie = Vec::new();
        let mut cache = HashMap::new();
        
        Solution::get_value_indices(
            &numbers[..],
            numbers.len(),
            target,
            0,
            &mut serie,
            &mut cache
        );

        serie.into_iter().map(|i| (i as i32) + 1).collect::<Vec<_>>()
    }

    fn get_value_indices(
        numbers: &[i32],
        original_numbers_len: usize,
        target: i32,
        actual_sum: i32,
        serie: &mut Vec<usize>,
        mut cache: &mut HashMap<String, bool>
    ) -> bool {
        let actual_numbers_len = numbers.len();
        
        
        if serie.len() != 0 {
            if actual_sum == target {
                if serie.len() == 2 {
                    return true;
                } else {
                    match numbers.iter().position(|n| *n == 0) {
                        None => { return false; }
                        Some(indice) => {
                            serie.push(indice + (original_numbers_len - actual_numbers_len));
                            return true;
                        } 
                    }
                }
            } else {
                if serie.len() == 2 {
                    return false;
                }
            }
        }
        if numbers.is_empty() { return false; }

        for (indice, number) in numbers.iter().enumerate() {
            let sum = actual_sum + number;

            if serie.len() != 0 && cache.contains_key(&String::from(actual_sum.to_string() + " " + &number.to_string())) {
                continue;
            }

            if target < 0 {
                if actual_sum < target {
                    if *number > 0 && sum > target {
                        break;
                    }
                } else {
                    if *number > 0 {
                        break;
                    }
                }
            } else {
                if sum > target {
                    break;
                }
            }

            serie.push(indice + (original_numbers_len - actual_numbers_len));
                
            let get_next_indice = Solution::get_value_indices(
                &numbers[(indice + 1)..],
                original_numbers_len,
                target,
                sum,
                serie,
                &mut cache
            );

            if get_next_indice {
                return true;
            } else {
                if serie.len() != 0 { cache.insert(String::from(actual_sum.to_string() + " " + &number.to_string()), false); }
                serie.pop();
            }

            // if sum < 0 {
            //     if target < 0 {
                    
            //     }
            // }
            
            // if target > 0 {
            //     if sum > target {
            //         cache.insert(sum, false);
            //         return false;
            //     }
            // } else {
            //     if sum.abs() < target.abs() {
            //         cache.insert(sum, false);
            //         return false;
            //     }
            // }
            // if sum.abs() > target.abs() && target != 0 {
            //     return false;
            // } else {
            //     serie.push(indice + (original_numbers_len - actual_numbers_len));
                
            //     let get_next_indice = Solution::get_value_indices(
            //         &numbers[(indice + 1)..],
            //         original_numbers_len,
            //         target,
            //         sum,
            //         serie,
            //         &mut cache
            //     );

            //     if get_next_indice {
            //         return true;
            //     } else {
            //         cache.insert(sum, false);
            //         serie.pop();
            //     }
            // }
        }

        false
    }
}